pragma solidity ^0.5.11;

import "./NoSignature.sol";
import "../../eternal-storage/EternalStorageInterface.sol";

/// @title A factory contract
/// @notice This contract is used to deploy other document contracts and store the uploaders contracts' addresses
contract FactoryNoSignature {

  EternalStorageInterface es;

  /// @notice Assigns eternal storage address to variable upon construction
  /// @dev called upon setting up of the jedsign infrastructure
  /// @param _eternalStorage Address of eternal storage for created signature contract information
  constructor(address _eternalStorage) public {
    es = EternalStorageInterface(_eternalStorage);
  }

  /// @notice Checks if msg.sender is an admin by referencing eternal storage
  /// @param _address parameter would be msg.sender
  modifier isAdmin(address _address) {
    require(es.isAccountAdmin(_address), "Must be a valid admin");
    _;
  }

  /// @notice function to change eternal storage address
  /// @dev called when we change eternal storages, function checks if account is admin
  /// @param _newEternal Address of the new eternal storage
  function changeEternal(address _newEternal) external isAdmin(msg.sender) {
    es = EternalStorageInterface(_newEternal);
  }

  event CreateDocEvent(address indexed _from, address indexed _newDoc, uint256 _date);

  /// @notice Creates No Signature Document and store contract's address in mapping
  /// @dev Invoked by uploader using metamask
  /// @param dochash The document's hash
  /// @param date Unix timestamp of invokation of function
  /// @param fileName description/name of file
  function createNoSignature(
    bytes32 dochash,
    uint256 date,
    string memory fileName
  ) public {

//    address[] memory signAdds = new address[](0);
//    bytes32[] memory signEmails = new bytes32[](0);
    address[] memory signAdds;
    bytes32[] memory signEmails;
    uint256 signaturesNeeded;

    require(signAdds.length == signEmails.length, "Addresses provided do not match emails provided");
    require(signaturesNeeded <= signAdds.length, "Signatures required cannot be achieved by number of signatories");

    address newDocument = address(
      new NoSignature(
        msg.sender,
        address(es),
        dochash,
        signAdds,
        signEmails,
        date,
        0,
        fileName
      )
    );

    es.addUploaderContract(4, msg.sender, newDocument, dochash);
    es.incrementMetrics("NOSIG_ISSUED");

    emit CreateDocEvent(msg.sender, newDocument, date);

  }

}

